  qzRawPrint(): void {
    const rawCommands = this.getRawInvoiceBill();
    qz.api.setSha256Type((data) => sha256(data));
    qz.api.setPromiseType((resolver) => new Promise(resolver));

    const that = this;
    console.log(qz);
    console.log(qz.printers.getDefault());
    qz.websocket
      .connect()
      .then(qz.printers.getDefault)
      .then((printer) => {
        const config = qz.configs.create(printer);
        return qz.print(config, rawCommands);
      })
      .then(qz.websocket.disconnect)
      .catch((err) => console.error(err));
  }

  getRawInvoiceBill(): any {
    const esc = '\x1B';
    const newLine = '\x0A';

    const align = '\x61';
    const rightAlign = esc + align + '\x32';
    const centerAlign = esc + align + '\x31';
    const leftAlign = esc + align + '\x30';

    const emTagOpen = '\x1B' + '\x21' + '\x30';
    const emTagClose = '\x1B' + '\x21' + '\x0A' + '\x1B' + '\x45' + '\x0A';

    const boldTagOpen = '\x1B' + '\x45' + '\x0D';
    const boldTagClose = '\x1B' + '\x45' + '\x0A';

    const marginLine = '==============================';

    // return [
    //   { type: 'raw', format: 'image', flavor: 'file', data: this.getBase64Logo() ,
    // options: { language: 'ESCPOS', dotDensity: 'double' } },

    // ];
    return [
      esc + newLine,
      emTagOpen,
      centerAlign,
      this.store_name + newLine,
      emTagClose,
      newLine,
      esc + '!' + '\x00',
      this.store_name,
      newLine,
      this.invoice_details?.user_id,
      newLine,
      boldTagOpen,
      'INV NO :' + this.invoice_no,
      newLine,
      'DATE :' + this.getDateFormat(this.invoice_date),
      newLine,
      'CUST. :' + this.customer_name,
      boldTagClose,
      newLine,
      leftAlign,
      marginLine,
      newLine,
      'PRD               QTY    PRICE',
      newLine,
      marginLine,
      newLine,
      ...this.productRawList(),
      newLine,
      marginLine,
      newLine,
      esc + '!' + '\x00',
      '# ITEMS SOLD ' + this.invoice_details.order_details.length,
      newLine,
      marginLine,
      marginLine,
      newLine,
      esc + '!' + '\x00',
      'CGST :' + (this.invoice_details?.total_gst_amount/2).toFixed(2),
      newLine,
      'SGST :' + (this.invoice_details?.total_gst_amount/2).toFixed(2),
      newLine,
      marginLine,
      newLine,
      esc + '!' + '\x05',
      'GST :' + this.invoice_details?.total_gst_amount,
      newLine,
      'TOTAL :' + this.grandTotal,
      newLine,
      esc + '!' + '\x00',
      marginLine,
      newLine,
      'TANS ID :' + this.invoice_details?.transaction_id,
      newLine,
      'PAYMENT MODE :' + this.invoice_details?.payment_terms,
      newLine,
      marginLine,
      newLine,
      centerAlign,
      '          THANK YOU           ',
      newLine,
      centerAlign,
      '     '+this.store_name+'     ',
      newLine,
      centerAlign,
      '         VISIT AGAIN          ',
      newLine,
      marginLine,
      newLine,
      newLine,
      newLine,
      newLine
    ];
  }
  productRawList(): any {
    const rawString: any = [];
    this.invoice_details.order_details.forEach(element => {

      element.product__product_name = element.product__product_name === null? element.service__service_name:element.product__product_name;

      const line1 = element.product__product_name + '  ' +
      Array(element.product__product_name.length < 15 ? 15 - element.product__product_name.length : 0).fill(' ').join('') +
      parseInt(element.qty).toString() + Array(element.qty.toString().length <= 5 ? 5 - element.qty.toString().length : 0).fill(' ').join('') + '   ' +
      element.subtotal_amount;
      rawString.push(line1);
      rawString.push('\x0A');
      rawString.push(element.product__product_name.substr(15, 30));
      rawString.push('\x0A');
    });
    return rawString;
  }

